import FileIcons from './Files/FileIcons';
import FileUpload from './Files/FileUpload';

function App() {
  return (
    <div className="App">
      <Header />
      <div className="body">
        <FileUpload />
        <FileIcons />
      </div>
    </div>
  );
}

export default App;
